import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppComponent } from './app.component';
import {AdminModule } from './components/admin/admin.module'
import { UtilisateurModule } from './components/utlisateur/utilisateur.module';
import { AppRoutingModule } from './app-routing.module';
import { DashboardComponent } from './components/admin/dashboard/dashboard.component';
import { DashboardSlideComponent } from './component/dashboard-slide/dashboard-slide.component';

@NgModule({
  declarations: [
    AppComponent,
    DashboardComponent,
    DashboardSlideComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    AdminModule, // Importation du module Admin
    UtilisateurModule  // Importation du module Pages
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
